import React from "react";
import { useNavigate } from "react-router-dom";
function Pay() {
  return (
    <Button
      color="primary"
      size="lg"
      onClick={() => (window.location.href = "check.html")}
    >
      Scan Asset
    </Button>
  );
}

export default Pay;
